import React, { useState } from 'react';
import { makeStyles, useTheme } from '@mui/styles';
import Grid from '@mui/material/Grid';
import Typography from '@mui/material/Typography';
import SearchBarV1 from '../components/SearchBarV1';
import AppButton from '../components/AppButton';

const useStyles = makeStyles(theme => ({
    mr1: {
        marginRight: '1rem !important'
    },
    mr1: {
        marginRight: '1rem !important'
    }
}));

function SearchPage( { isOldVersion } ) {
    const theme = useTheme();
    const classes = useStyles();
    console.log(theme);

    const [isSearching, setIsSearching] = useState(false);

    const startSearch = () => {
        setIsSearching(true);
    };

    const cancelSearch = () => {
        setIsSearching(false);
    };

    return (
        <Grid container alignItems="flex-start" justifyContent="flex-start">
            {isOldVersion && (
                    <SearchBarV1 
                        isSearching={isSearching} 
                        startSearch={startSearch} 
                        cancelSearch={cancelSearch}
                    />

            )}
            {isOldVersion && isSearching && (
                <Grid item className={classes.mt1}>
                    <AppButton content="Sports" className={classes.mr1} />
                    <AppButton content="Sports" />
                </Grid>
            )}
        </Grid>
    );
}

export default SearchPage;
